import React, { Fragment, useEffect } from "react";

const ProfileItems = ({
  profile: {
    user: { _id, name, avatar },
    status,
    skills,
    company,
    location
  }
}) => {
  return <div className='profile bg-light'></div>;
};
export default ProfileItems;
